@contfromprev @thehellisthatt @RBReich @elonmusk Government has grown too large to be adequately managed or overseen and as such is inefficient and wasteful.

We care that what government does with our taxes is useful and productive.

We want to live our lives in freedom with as little involvement from government as possible.

@RBReich The wealth tax is already in effect.

The top 20% of wage earners pay 87% of the income taxes.

The top 1% of wage earners earn 21% of the income, but pay 43% of the taxes.

@elonmusk just paid the highest individual income tax in US history, over $11 billion.

